g.script:
    
var svgDocument = null;
svgDocument = window.document;
//alert(svgDocument.getElementsByTagName('rect').length);

// definit une nouvelle propriete window reference top
top.addEvents = addEvents;
             // definition de la methode
             function addEvents () {
   var list = svgDocument.getElementsByTagName('path');
                   for(var i=0;i<list.length;i++){       if(i == list.length-1  list[i].parentNode.nodeName == 'g')           list[i].parentNode.setAttribute('id','canvas');                        var rectangle = list[i];   
                        rectangle.addEventListener('mouseover',highlight,false);
                        rectangle.addEventListener('mouseout',unhighlight,false);
                        //rectangle.addEventListener('mousemove',moveText,false);
                                               }             }
             function moveText(evt) { var text = svgDocument.getElementById('text');
                 if (text == null){alert('text is null');   
     var text = svgDocument.createElement('text');   
     evt.target.parentNode.appendChild(text); 
     text.setAttribute('id','text'); 
     text.setAttribute('width','200'); 
     text.setAttribute('height','100'); 
     text.setAttribute('fill','red'); 
     text.appendChild(document.createTextNode('X: Y: stronzo')); 
 }                 text.setAttribute('style','display:block;');
                 text.setAttribute('x',evt.clientX+10);
                 text.setAttribute('y',evt.clientY-10);
                 if(text.firstChild.data)
                      text.firstChild.data = 'X: '+evt.target.getAttribute('xValue')+',Y: '+parseInt(evt.target.getAttribute('yValue'));
                 else if(text.firstChild.nodeValue)
                      text.firstChild.nodeValue= 'X: '+evt.target.getAttribute('xValue')+',Y: '+parseInt(evt.target.getAttribute('yValue'));
             }             function displayText(evt) {
                  var text = svgDocument.getElementById('text');   
                  if(text.getAttribute('style').indexOf('none;')!=-1){
                        text.setAttribute('style','display:block;');
                  } else{  text.setAttribute('style','display:none;');}
             }
             // methode ajoutee si element rectangle
             function highlight(evt) {
                 //evt.target.setAttribute('default-fill',evt.target.getAttribute('fill'));  
                 //evt.target.setAttribute('fill','yellow');
svgDocument.getElementById('text').style.display='block';moveText(evt);
 if (evt.target.getAttribute('stroke') == 'none') {
                     evt.target.setAttribute('default-stroke',evt.target.getAttribute('stroke'));  
                     evt.target.setAttribute('stroke','yellow');
 }                 evt.target.setAttribute('default-stroke-width',evt.target.getAttribute('stroke-width'));  
                 evt.target.setAttribute('stroke-width','4');
             }
             function unhighlight(evt) {
                 //evt.target.setAttribute('fill',evt.target.getAttribute('default-fill'));  
svgDocument.getElementById('text').style.display='none';
                 if (evt.target.getAttribute('default-stroke'))
     evt.target.setAttribute('stroke',evt.target.getAttribute('default-stroke'));  
                 evt.target.setAttribute('stroke-width',evt.target.getAttribute('default-stroke-width'));  
             }
            loadOpenCharts('canvas');
            addEvents();
